const jokeData = [
    {
        id: 1,
        question: "Co to znaczy jak daltoniście nie smakuje marchewka?",
        punchline: "Kolejna pierniczona pietruszka!"
    },
    {
        id: 2,
        question: "Jak się nazywa samolot przewożący owce?",
        punchline: "Transportowiec"
    },
    {
        id: 3,
        question: "Ile żyje robak wędkarza?",
        punchline: "Dwa dni z hakiem"
    },
    {
        id: 4,
        question: "Który lekarz nigdy nie stosuje przedłużaczy?",
        punchline: "Pierwszego kontaktu!"
    },
    {
        id: 5,
        question: "Jak się nazywa czworonożny przyjaciel człowieka?",
        punchline: "Tapczan"
    },
    {
        id: 6,
        punchline: "Tapczan"
    },
]

export default jokeData
